import React from 'react';
import { DateRangePicker } from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css'; 
export const Instance = () => {
  return (
    <div>
      <DateRangePicker
        appearance="default"
        placeholder="Default"
        style={{ width: 280 }}
      />
      <hr />
      <DateRangePicker
        appearance="subtle"
        placeholder="Subtle"
        style={{ width: 280 }}
      />
    </div>
  )

};
